def get_proxies():

    proxies = getproxies()

    filtered_proxies = {}

    for key, value in proxies.items():

        if key.startswith('http'):

            if not value.startswith('http'):

                filtered_proxies[key] = f'http://{value}'

            else:

                filtered_proxies[key] = value

    return filtered_proxies
